import React, { Component } from 'react'

export class PostDetail extends Component {
    // let {post} = this.props
    render() {
        let { title, discription, created_at, updated_at } = this.props.post
        return (
            <div>
                Title: {title}
                Discription: {discription}
                Created: {created_at}
                Updated: {updated_at}
            </div>
        )
    }
}

export default PostDetail
